import React from 'react';
import headerLogo from '../images/calorieZen.png';
import './Header.css';

function Header() {
  return (
  	<div>
  	  <img className="headerLogo" alt="Calorie-Zen Logo" src={headerLogo} />
      <h1 className="Header">Calorie-Zen</h1>
    </div>  
  );
}

export default Header;
